import React from "react";
import { useState } from "react";
import "../css/Slider.css"
class Header extends React.Component {
    constructor()
    {
        super();
        this.state = {name : "0", value : "1"}
    }
    render() {
      return (
        <div>
            <div class="wrapper">
            <div class="label not-fun">Not So Gooey</div>
            <div class="slidershell" id="slidershell1">
                <div class="slidertrack" id="slidertrack1"></div>
                <div class="sliderfill" id="sliderfill1"></div>

                <div class="sliderthumb" id="sliderthumb1"></div>

                <input class="slider" id="slider1" style={{width : "100%", color : "red"}} value={this.state.name} name="range" type="range" id="customRange1" min={0} max={100} step={10} onChange={e => this.setState({name : e.target.value})} />
            </div>
            <div class="label fun">Gooey</div>
            </div>
            <div className="float-left">Abc</div>
            <div className="float-right">Abc</div>
            <div>{this.state.name}</div>
            <input style={{width : "100%", color : "red"}} value={this.state.name} name="range" type="range" id="customRange1" min={0} max={100} step={10} onChange={e => this.setState({name : e.target.value})} />
        </div>
      );
    }
  }
  
  export default Header;
